import "../../styles/Project.css";

const Project = (props) => {
    return (
        <div className="projectContainer">
            <div className="projectContainer-header">
                <image className="projectContainer-header-image"/>
                <span className="projectContainer-header-title">{props.title}</span>
                <span className="projectContainer-header-visibility_status">{props.status}</span>
            </div>
            <div className="projectContainer-desc">{props.desc}</div>
            <div className="projectContainer-footer">
                <span className="projectContainer-footer-langIcon"/>
                <span className="projectContainer-footer-language">{props.lang}</span>
                
            </div>
        </div>
    );
}

export default Project;
